Map {
User Stories {
Display Unsupported Orders: As a user, I want to be able to view orders that are not supported by the Martial Arts application.
Select Travel Time: As a user, I want to be able to select a travel time for my martial arts class.
View Class Schedule: As a user, I want to be able to view the class schedule for the martial arts classes I am interested in.
Book Classes: As a user, I want to be able to book classes for the martial arts classes I am interested in.
View Class Details: As a user, I want to be able to view the details of the martial arts classes I am interested in.
Pay for Classes: As a user, I want to be able to pay for the martial arts classes I am interested in.
View Payment History: As a user, I want to be able to view my payment history for the martial arts classes I am interested in.
}
Admin Stories {
Manage Classes: As an admin, I want to be able to manage the classes offered by the Martial Arts application.
Manage Payments: As an admin, I want to be able to manage the payments for the martial arts classes.
Manage Users: As an admin, I want to be able to manage the users of the Martial Arts application.
}
}
